import React from 'react';
import { styled } from 'styled-components';

const Img = styled.img `
  border: 1px solid red;
`;

const Product = ({it}) => {
  return (
    <div>
      <img src={it.img}/>
      <div>{it.title}</div>
      <div>{it.price}</div>
    </div>
  )
}

export default Product;
